import { createStore } from 'redux';
import formSubmitReducer from './reducers/';

const defaultState = {
	Info: {
		appName : 'Zevac',
		email : null,
        mobile : null,
        first_name : null,
        last_name : null,

	}
}
export {defaultState}
export const store = createStore(formSubmitReducer,defaultState);
